USE master;

DROP DATABASE IF EXISTS MokeSellDBAsg;
CREATE DATABASE MokeSellDBAsg;

GO
USE MokeSellDBAsg;

DROP TABLE IF EXISTS Award;
CREATE TABLE Award (AwardID INT PRIMARY KEY IDENTITY(1,1), AwardName VARCHAR(120) NOT NULL, AwardAmt SMALLMONEY);

DROP TABLE IF EXISTS Bump;
CREATE TABLE Bump (BumpID INT PRIMARY KEY IDENTITY(1,1), BumpDesc VARCHAR(999), BumpPrice SMALLMONEY NOT NULL);

DROP TABLE IF EXISTS Category;
CREATE TABLE Category (CatID INT PRIMARY KEY IDENTITY(1,1), CatDesc VARCHAR(999) NOT NULL);

DROP TABLE IF EXISTS FeedbkCat;
CREATE TABLE FeedbkCat (FbkCatID INT PRIMARY KEY IDENTITY(1,1), FbkCatDesc VARCHAR(999) NOT NULL);

DROP TABLE IF EXISTS Member;
CREATE TABLE Member (MemberID INT PRIMARY KEY IDENTITY(1,1), MemberName NVARCHAR(100) NOT NULL, MemberDOB DATETIME, MemberEmail VARCHAR(100), MemberMobile VARCHAR(8) CHECK ((MemberMobile LIKE '8%' OR MemberMobile LIKE '9%' OR MemberMobile LIKE '6%') AND LEN(MemberMobile) = 8), MemberDateJoined DATETIME NOT NULL, City VARCHAR(100));

DROP TABLE IF EXISTS Buyer;
CREATE TABLE Buyer (BuyerID INT FOREIGN KEY REFERENCES Member(MemberID) PRIMARY KEY);

DROP TABLE IF EXISTS Seller;
CREATE TABLE Seller (SellerID INT FOREIGN KEY REFERENCES Member (MemberID) PRIMARY KEY);

DROP TABLE IF EXISTS SubCategory;
CREATE TABLE SubCategory (SubCatID INT PRIMARY KEY IDENTITY(1,1), SubCatDesc VARCHAR(999) NOT NULL, CatID INT FOREIGN KEY REFERENCES Category(CatID) NOT NULL);

DROP TABLE IF EXISTS Listing;
CREATE TABLE Listing (ListingID INT PRIMARY KEY IDENTITY(1,1), ListDesc VARCHAR(1000), ListDateTime DATETIME NOT NULL, ListPrice MONEY NOT NULL, ListStatus VARCHAR(9) CHECK (ListStatus = 'Available' OR ListStatus = 'Sold' OR ListStatus = 'Inactive') NOT NULL, SellerID INT FOREIGN KEY REFERENCES Seller(SellerID) NOT NULL, SubCatID INT FOREIGN KEY REFERENCES SubCategory(SubCatID) NOT NULL);

DROP TABLE IF EXISTS Follower;
CREATE TABLE Follower (MemberID INT FOREIGN KEY REFERENCES Member(MemberID) NOT NULL, FollowerID INT FOREIGN KEY REFERENCES Member(MemberID) NOT NULL, DateStarted DATETIME NOT NULL, CONSTRAINT MemberCombKey_PK PRIMARY KEY (MemberID,FollowerID));

DROP TABLE IF EXISTS Likes;
CREATE TABLE Likes (BuyerID INT FOREIGN KEY REFERENCES Buyer(BuyerID) NOT NULL, ListingID INT FOREIGN KEY REFERENCES Listing(ListingID) NOT NULL, DateLiked DATETIME NOT NULL, CONSTRAINT Like_PK PRIMARY KEY (BuyerID, ListingID));

DROP TABLE IF EXISTS ListingPhoto;
CREATE TABLE ListingPhoto (ListingID INT FOREIGN KEY REFERENCES Listing(ListingID) NOT NULL, Photo VARCHAR(100) NOT NULL, CONSTRAINT Photo_PK PRIMARY KEY (ListingID, Photo));

DROP TABLE IF EXISTS Offer;
CREATE TABLE Offer (OfferID INT PRIMARY KEY IDENTITY(1,1), BuyerID INT FOREIGN KEY REFERENCES Buyer(BuyerID) NOT NULL, ListingID INT FOREIGN KEY REFERENCES Listing(ListingID) NOT NULL, OfferPrice MONEY NOT NULL, OfferStatus VARCHAR(9) CHECK (OfferStatus = 'Submitted' OR OfferStatus = 'Pending' OR OfferStatus = 'Accepted' OR OfferStatus = 'Rejected' OR OfferStatus = 'Completed') NOT NULL, OfferDate DATETIME NOT NULL);

DROP TABLE IF EXISTS Chat;
CREATE TABLE Chat (ChatID INT PRIMARY KEY IDENTITY(1,1), BuyerID INT FOREIGN KEY REFERENCES Buyer(BuyerID) NOT NULL, ListingID INT FOREIGN KEY REFERENCES Listing(ListingID) NOT NULL);

DROP TABLE IF EXISTS ChatMsg;
CREATE TABLE ChatMsg (ChatID INT FOREIGN KEY REFERENCES Chat(ChatID) NOT NULL, MsgSN VARCHAR(99) NOT NULL, MsgDateTime DATETIME2 NOT NULL, Originator VARCHAR(6) CHECK (Originator = 'Seller' OR Originator = 'Buyer') NOT NULL, Msg VARCHAR(1000) NOT NULL, CONSTRAINT PK_ChatMsg PRIMARY KEY (ChatID, MsgSN));

DROP TABLE IF EXISTS Staff;
CREATE TABLE Staff (StaffID INT PRIMARY KEY IDENTITY(1,1), StaffName NVARCHAR(100) NOT NULL, StaffMobile CHAR(8) CHECK ((StaffMobile LIKE '8%' OR StaffMobile LIKE '9%' OR StaffMobile LIKE '6%') AND LEN(StaffMobile) = 8), StaffDateJoined DATETIME NOT NULL);

DROP TABLE IF EXISTS Team;
CREATE TABLE Team (TeamID INT PRIMARY KEY IDENTITY(1,1), TeamName NVARCHAR(100) NOT NULL, TeamLeaderID INT FOREIGN KEY REFERENCES Staff(StaffID) NOT NULL);

ALTER TABLE Staff ADD TeamID INT FOREIGN KEY REFERENCES Team(TeamID);

DROP TABLE IF EXISTS Win;
CREATE TABLE Win (AwardID INT FOREIGN KEY REFERENCES Award(AwardID) NOT NULL, TeamID INT FOREIGN KEY REFERENCES Team(TeamID) NOT NULL, DateAwarded DATETIME NOT NULL, CONSTRAINT Win_PK PRIMARY KEY (AwardID, TeamID, DateAwarded));

DROP TABLE IF EXISTS Review;
CREATE TABLE Review (ReviewID INT PRIMARY KEY IDENTITY(1,1), OfferID INT FOREIGN KEY REFERENCES Offer(OfferID) NOT NULL, MemberType VARCHAR(6) CHECK (MemberType = 'Seller' OR MemberType = 'Buyer') NOT NULL, ReviewDate DATETIME NOT NULL, ItemRank TINYINT CHECK ((ItemRank BETWEEN 1 AND 5) AND (ItemRank > 0)), DeliveryRank TINYINT CHECK ((DeliveryRank BETWEEN 1 AND 5) AND (DeliveryRank > 0)), CommunicationRank TINYINT CHECK ((CommunicationRank BETWEEN 1 AND 5) AND (CommunicationRank > 0)), Comment VARCHAR(999));

DROP TABLE IF EXISTS FeedBack;
CREATE TABLE FeedBack (FbkID INT PRIMARY KEY IDENTITY(1,1), ByMemberID INT FOREIGN KEY REFERENCES Member(MemberID) NOT NULL, FbkCatID INT FOREIGN KEY REFERENCES FeedbkCat(FbkCatID) NOT NULL, FbkDesc VARCHAR(999) NOT NULL, FbkDateTime DATETIME NOT NULL, FbkStatus VARCHAR(19) CHECK (FbkStatus = 'Pending' OR FbkStatus = 'Receiving Attention' OR FbkStatus = 'Completed') NOT NULL, SatisfactionRank TINYINT CHECK ((SatisfactionRank BETWEEN 1 AND 5) AND (SatisfactionRank > 0)), OnMemberID INT FOREIGN KEY REFERENCES Member(MemberID) NOT NULL, StaffID INT FOREIGN KEY REFERENCES Staff(StaffID) NOT NULL);

DROP TABLE IF EXISTS BumpOrder;
CREATE TABLE BumpOrder (BumpOrderID INT PRIMARY KEY IDENTITY(1,1), PurchaseDate DATETIME NOT NULL, SellerID INT FOREIGN KEY REFERENCES Seller(SellerID) NOT NULL, BumpID INT FOREIGN KEY REFERENCES Bump(BumpID) NOT NULL, ListingID INT FOREIGN KEY REFERENCES Listing(ListingID) NOT NULL);

-- Inserting all values


















DECLARE @CursorTestID INT = 1;
DECLARE @TempTable TABLE (prevnum INT);
DECLARE @counter INT = 1

WHILE @counter <= (SELECT COUNT(*) FROM Staff)
BEGIN
    UPDATE Staff
    SET TeamID = (@counter % 50) + 1
    WHERE StaffID = (SELECT MIN(StaffID) FROM Staff WHERE TeamID IS NULL)

    SET @counter = @counter + 1
END
DECLARE @teamID INT

DECLARE TeamCursor CURSOR FOR 
    SELECT TeamID FROM Team

OPEN TeamCursor

FETCH NEXT FROM TeamCursor INTO @teamID

WHILE @@FETCH_STATUS = 0
BEGIN
    UPDATE Team
    SET TeamLeaderID = (SELECT TOP 1 StaffID FROM Staff WHERE TeamID = @teamID)
    WHERE TeamID = @teamID

    FETCH NEXT FROM TeamCursor INTO @teamID
END

CLOSE TeamCursor
DEALLOCATE TeamCursor



